webpackJsonp([89133557958983],{5904:function(e,t){e.exports={data:{post:{html:'<p>I\'m now listed at the home page of <a title="BlogTalk - A European Weblog-Conference" href="http://blogtalk.net/">BlogTalk - A European Weblog-Conference</a> (to be held this May in Vienna) as having submitted a proposal for a talk. That\'s not quite correct... I\'ve submitted a title and a promise to flesh it out. But I do (in my humble opinion) have a good title: "Warblogs for Euro-Weenies -  Searching for the DeutschePundit". Eight words down, one thousand four hundred ninety-two to go. </p>\n<p>Since I was always able to ace the essay questions in college, it should be no problem for me to \'Contrast and compare the development of politcal weblogs in Germany and the United States, with particular emphasis on the differences in internet usage, journalistic standards and political culture\'.  </p>\n<p>Speaking of which, can anyone point me to any German political blogs that are CDU/CSU-oriented?</p>\n<p>(Weenies. Vienna. Get it? Oh, I am <em>so</em> clever. ;-)</p>',fields:{title:"Warblogs for Euro-Weenies",date:"11 Feb 2003",url:"https://papascott.de/2003-02-11-warblogs-for-euro-weenies/"}}},pathContext:{slug:"/2003-02-11-warblogs-for-euro-weenies/",prev:{fields:{title:"Guillaume Affair",date:"10 Feb 2003",slug:"/2003-02-10-guillaume-affair/"}},next:{fields:{title:"Discontinued Merchandise",date:"12 Feb 2003",slug:"/2003-02-12-discontinued-merchandise/"}}}}}});
